import { Avatar, Grid } from "@mui/material";

const Profile = () => {
  return (
    <Grid container justifyContent="center" alignItems="center">
      <Grid item>
        <Avatar>Azul</Avatar>
      </Grid>
    </Grid>
  );
};

export default Profile;
